  function getPointGrid(radius){
    let hexDistance = radius * 1;

    let cols = width / hexDistance; //nombre de colonnes
    let rows = Math.floor(height / hexDistance); //nobre de lignes

    return d3.range(rows * cols).map(function(i) {
      return {
        x: i % cols * hexDistance,
        y: Math.floor(i / cols) * hexDistance,
        datapoint: 0
      }
    })
  }


  function getPolygon(geojson){
    let featurePolygon = [];
    geojson.forEach(function(f){
      f[0].forEach(function(c){
        featurePolygon.push(projection(c));
      })
    })
    return featurePolygon;
  }

  function isInBuffer(area, point){
    let inBuffer = false;
    area.forEach(function(p){
      let Xdist = p[0]-point.x;
      let Ydist = p[1]-point.y;

      let X = Math.pow(Xdist, 2);
      let Y = Math.pow(Ydist, 2);
      let distance = Math.sqrt(X + Y);

      if(distance <= hexRadius){
        point.x = point.x - Xdist;
        point.y = point.y - Ydist;

        inBuffer = {x: point.x, y: point.y};
        return false;
      }
    })
    return inBuffer;
  }


  function keepPointsInPolygon(points, africa) {

    let pointsInPolygon = [];

    points.forEach(function(point){ //pour tous les ponts d'hexagones

      if (d3.polygonContains(africa, [point.x, point.y])){
        pointsInPolygon.push(point);
      }else{

        let newCoords = isInBuffer(africa, point);
        if(newCoords){
          point.x = newCoords.x;
          point.y = newCoords.y;
        }
        pointsInPolygon.push(point);
      }
    })

    return pointsInPolygon;
  }

