  function getRelevantHex(points){
    relevantHex = [];

    points.forEach(function(el){
      if(el.nb_mines > 0){
        relevantHex.push(el);
      }
    })

    return relevantHex;
  }

  function getIcon(point){
    let mine_types = point.mines;
    let nb_max = 0;
    let max_mine_type = [];

    for(let type in mine_types){
      const nb_mines = mine_types[type];

      if(nb_mines > nb_max){
        max_mine_type = [];
        max_mine_type.push({type, nb_mines});
        nb_max = nb_mines;
      }else if(nb_mines == nb_max){
        max_mine_type.push({type, nb_mines});
      }
    }
    
    return max_mine_type[0].type;
  }

