  function mouseIcons() {

    const iconsToDisplay = [];
    let name_mine_type = "";

    let tooltip_legend = nav.append('div')
        .attr("id", "tooltip-legend")
        
    let tooltip_legend_text = tooltip_legend.append("p");

    //Au survol
    
    d3.selectAll('.ico').on('mouseover', function(e){
      const mine_type = d3.select(this).node().classList[2];
      if(!d3.select(this).node().classList.contains("hided")){
        document.getElementsByClassName('line-legend ' + mine_type)[0].classList.add("bigger");
      }
    });

    d3.selectAll('.ico').on('mouseout', function(e){
      const mine_type = d3.select(this).node().classList[2];
      document.getElementsByClassName('line-legend ' + mine_type)[0].classList.remove("bigger");
    });

    d3.selectAll('.line-legend').on('mouseover', function(e){
      const line_legend = d3.select(this).node();
      const mine_type = line_legend.classList[1];
      const icons = document.getElementsByClassName('ico');
      name_mine_type = this.textContent;

      const infoLegend = document.getElementById("tooltip-legend");
      const tooltip_legend_height_px = window.getComputedStyle(infoLegend).height;
      const tooltip_legend_height = parseFloat(tooltip_legend_height_px);

      for(let ico of icons){
        if(ico.classList.contains(mine_type)) {
          ico.classList.add("more");
        }else{
          ico.classList.add("less");
        }
      }
        
      tooltip_legend_text
        .text(function(e){
          let message = "";

          if(iconsToDisplay.length < 5 && !line_legend.classList.contains("selected")){
            message = "Ajouter les mines de "+ name_mine_type +" sur la carte";
          }else if(line_legend.classList.contains("selected")){
            message = "Retirer les mines de "+ name_mine_type +" sur la carte";
          }else if(line_legend.classList.contains("disabled")){
            message = "Retirez un type de mine pour ajouter les mines de "+ name_mine_type +" sur la carte";
          }
          return message;
        });

      tooltip_legend
        .style('top', e.pageY - e.layerY - (tooltip_legend_height - this.offsetHeight)/2 + "px");

      tooltip_legend.node().classList.add("display");
    });

    d3.selectAll('.line-legend').on('mouseout', function(e){
      const mine_type = d3.select(this).node().classList[1];
      const icons = document.getElementsByClassName('ico');

      for(let ico of icons){
        if(ico.classList.contains(mine_type)) {
          ico.classList.remove("more");
        }else{
          ico.classList.remove("less");
        }
      }

      tooltip_legend.node().classList.remove("display");
    });

    //Au clique

    function clickToLine(e){
      const mine_type = this.classList[1];
      const ico = document.getElementsByClassName("ico-legend " + mine_type)[0];
      const icons = document.getElementsByClassName('ico');
      
      //Gestion de l'apparition des lignes de légende
      if(!this.classList.contains("selected")){
        iconsToDisplay.push(mine_type)
        this.classList.add("selected");
      }else{
          for(let i in iconsToDisplay){
            if(iconsToDisplay[i] == mine_type){
              iconsToDisplay.splice(i, 1);
            }
          }
          this.classList.remove("selected");
          ico.style.transform = null;
      }

      const linesNotSelected = document.querySelectorAll(".line-legend:not(.selected)");
      //Ne plus sélectionner de ligne lorsque 5 le sont
      if(iconsToDisplay.length >= 5){
        d3.selectAll(".line-legend").on('click', null);
        d3.selectAll(".line-legend.selected").on('click', clickToLine)
        for(let line of linesNotSelected){
          line.classList.add("disabled")
        }
      }else{
        d3.selectAll(".line-legend").on('click', clickToLine);
        for(let line of linesNotSelected){
          line.classList.remove("disabled")
        }
      }

      //Gestion des icônes à afficher
      if(iconsToDisplay.length){
        for(let ico of icons){
          ico.classList.add("hided");
          for(let icoToDisplay of iconsToDisplay){
            if(ico.classList.contains(icoToDisplay)) {
              ico.classList.remove("hided");
            }
          }
        }
      }else{
        for(let ico of icons){
            ico.classList.remove("hided");
        }
      }

    }
      
    d3.selectAll(".line-legend").on('click', clickToLine);

  }

  function mouseCountry(codeISO) {

    let tooltip_country = d3.select("#map").append('div')
        .attr("id", "country-selected")
        
    let tooltip_country_content = tooltip_country.append("div")
      .attr("id", "country-content");

    let tooltip_country_flag = tooltip_country_content.append("img");
    let tooltip_country_text = tooltip_country_content.append("h2");

    function hover(e){
      let countryId = this.id;

      codeISO.forEach(function(country) {
        if(country.country == countryId){
          tooltip_country_flag
            .attr("src", "https://flagsapi.com/"+ country.ISO2 +"/flat/64.png")
            .attr("alt", "Drapeau de "+ country.country)
            .attr("title", "Drapeau de "+ country.country);
          
          tooltip_country_text.text(countryId);
        }
      })

      tooltip_country.node().classList.toggle("display");
    }

    d3.selectAll('.country-africa-gradient').on('mouseover', hover);
    d3.selectAll('.country-africa-gradient').on('mouseout', hover);
  }

